function showFieldError(field,message){field.addClass('b-field-error');var fieldWrap=field.closest('.b-field');fieldWrap.find('.b-field-error-text').remove();if(message){$('<div>').addClass('b-field-error-text').text(message).appendTo(fieldWrap);}}